import React from "react";
import { takeRandomUnit } from "./units/Units";

const App: React.FC = () => {
  const rederGameBoard = (): any => {
    for (let i = 0; i < 12; ++i) {
      const unit: any = takeRandomUnit();
      return (
        <div className="cell">
          <button>
            <progress></progress>
            <img src={unit._imgPath} alt="img" />
          </button>
        </div>
      );
    }
  };
  return <div className="app">{rederGameBoard()}</div>;
};

export default App;
